fields.description:
A key signature applicable to this and all following measures, until changed.

&lt;key&gt; elements in &lt;global&gt; are required for every key change. &lt;key&gt; elements below &lt;part&gt; are optional; if present, their "fifths" value must either be identical to the corresponding value in the global key or different by a multiple of 12.

It is invalid to place more than one &lt;key&gt; element within a single &lt;measure&gt;
